import React, {Component} from 'react'
import { Container } from 'react-bootstrap/lib/Tab';
import './App.css'

class App extends Component {
    // React code goes here
    render() {
        return (
            <div>
                <div className='text-center' style={{color:'green', fontSize:'30px'}}>
                    'Hello World!!!'
                    <img src="https://cdn.pixabay.com/photo/2015/11/19/08/47/banner-1050615__340.jpg" alt="Flowers in Chania"></img>
                </div> 
                <div>
                    <img src="https://cdn.pixabay.com/photo/2015/11/19/08/47/banner-1050615__340.jpg" alt="Snow" style="width:100%;"></img>
                    <div class="bottom-left">Bottom Left</div>
                    <div class="top-left">Top Left</div>
                    <div class="top-right">Top Right</div>
                    <div class="bottom-right">Bottom Right</div>
                    <div class="centered">Centered</div>
                </div>   
            </div>
        )
    }
}

export default App;
